import { BrowserRouter, Routes, Route } from "react-router-dom";
import StoreHeader from "./components/StoreHeader";
import StoreFooter from "./components/StoreFooter";
import StoreHomepage from "./screens/StoreHomepage";
import StoreDetailspage from "./screens/StoreDetailspage";
import StoreNofound from "./screens/StoreNofound";

function App() {
  return (
    <BrowserRouter>
      <StoreHeader />
      <Routes>
        <main className="store__main">
          <Route exact path={"/"} element={<StoreHomepage />} />
          <Route exact path={"/details"} element={<StoreDetailspage />} />
          <Route path="*" element={<StoreNofound />} />
        </main>
      </Routes>
      <StoreFooter />
    </BrowserRouter>
  );
}

export default App;
